def tomysql(db, host='172.18.0.1', port=3307):
	''' db: kpsi  '''
	import pymysql
	my_conn = pymysql.connect(host=host,port=port,user='root',password='cikuutest!',db=db)
	with my_conn.cursor() as cursor: 
		cursor.execute(f"drop TABLE if exists word_idf")
		cursor.execute(f"CREATE TABLE if not exists word_idf(word varchar(64) COLLATE latin1_bin not null primary key, idf float not null default 0) engine=myisam  DEFAULT CHARSET=latin1 COLLATE=latin1_bin")
		cursor.executemany(f"insert ignore into word_idf(word, idf) values(%s, %s)",[(k,v) for k,v in word_idf.items()])
		my_conn.commit()
	print ("finished submitting:", db, flush=True) 

